\\n\\nCheck the links below for more SV Delos Sailing Around The World Action!\\n\\nwww.svdelos.com\\nwww.instagram.com\/svdelos\\nwww.facebook.com\/svdelos\\n\\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\\n\\nCheck the links below for more SV Delos Sailing Around The World Action!\\n\\nwww.svdelos.com\\nwww.instagram.com\/svdelos\\nwww.facebook.com\/svdelos\\n\\nOur Mission\\nIts simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET theres absolutely, positively, nothing more wed rather be doing with our time!\\n\\nWe hope by sharing this adventure you will find some inspiration in your life. If doesnt have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and dont forget to SMILE!\\n\\nSend Us Love\\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \\n\\nYour support will fund better camera gear, internet to upload videos, and of course creative lubricants to smooth the editing process :) \\n\\nSupport Our Videos- Buy us a cold one.\\nhttp:\/\/www.svdelos.com\/buy-us-a-beer\\n\\nMusic Used In this Video:\\nHidden Blues  - Pitx- Dig.ccmixter.org\\nKicked Up Pumps- Audionautix Audionautix.com\\nPop Star - Audionautix Audionautix.com\\nBlack Vortex - Kevin MacLeod \\nClouds - Audionautix Audionautix.com\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/AarLx_b1lQs\/hqdefaul Keeling and set sail for Chagos!  We say our goodbye's and stock Delos with provisions and fuel for the next 2 months.  After a last incredible dive in Cocos Keeling Brady washes his hands off the back of Delos and WHAM!  He gets an unpleasant surprise.....\n\nSubscribe at "},{"text":"http://youtube.com/svdelos","navigationEndpoint":{"clickTrackingParams":"CJwBEM2rARgBIhMI6fG2huKY6gIVVhsGAB1aVQgmSIuq1rf_-LLVAQ==","commandMetadata":{"webCommandMetadata":{"url":"http://youtube.com/svdelos","rootVe":83769}},"urlEndpoint":{"url":"http://youtube.com/svdelos","nofollow":true}}},{"text":"\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nThis is our story, a story of three souls sailing around the world.  It is a story about sailing, but it's also a story about the fantastic people we meet and amazing places we see.  It's a story of people living their lives in an alternate way, in close connection with the beautiful people and amazing planet that we call home.  Our experience has affected us so profoundly we want to share it, hoping that others may find inspiration to follow their dreams and do what they love.\n\nCheck the links below for more SV Delos Sailing Around The World Action!\n\nwww.svdelos.com\nwww.instagram.com/svdelos\nwww.facebook.com/svdelos\n\nOur Mission\nIts simple really- we just want to make you SMILE! We do this because we LOVE it. Given our short time on this AMAZING PLANET theres absolutely, positively, nothing more wed rather be doing with our time!\n\nWe hope by sharing this adventure you will find some inspiration in your life. If doesnt have to be sailing. It can be anything at all. Just take a few minutes every day for yourself, breathe deep and relax, and dont forget to SMILE!\n\nSend Us Love\nWe LOVE sailing, we LOVE traveling, and we LOVE making videos about it!  We're only half-way around the world, so there's plenty more to see! \n\nYour sup
